import{_ as i,o as a,c as e,a as l}from"./app-da280738.js";const r={},h=l('<h1 id="_24-january" tabindex="-1"><a class="header-anchor" href="#_24-january" aria-hidden="true">#</a> 24_January</h1><p>新的一年啦，24年希望越来越好，每天开开心心就好啦。</p><h3 id="_2024年1月1日" tabindex="-1"><a class="header-anchor" href="#_2024年1月1日" aria-hidden="true">#</a> 2024年1月1日</h3><ul><li>新的一年啦，日常放假睡到中午，下午来实验室摸鱼，继续整理了一下论文的related work，然后豁出去了一会，问三个打羽毛球的能不能加我一下，最后打了半个多小时吧应该有。</li><li>晚上回来看了一下视频，然后准备放到cpu上跑，结果跑了一晚上，code emebdding都跑不完，也是有点好笑。</li><li>元旦真无聊，这破学院人都不见几个，就这样吧，开启新的一月。希望这个月可以把论文初稿写完吧，然后就可以回家了。</li></ul><h3 id="_2024年1月2日" tabindex="-1"><a class="header-anchor" href="#_2024年1月2日" aria-hidden="true">#</a> 2024年1月2日</h3><ul><li>上午还是睡觉，啥也没干</li><li>下午继续看GPU占用，试了很多方法，还是没用，最后复制了一份环境，换成CPU环境</li><li>晚上就用CPU环境将方法在mylyn数据集上的各种模型选择运行了一下，得到了初步的结果，然后调整了一些代码结构，好难啊，python的包管理，在服务器运行py文件，总是报包找不到，麻了</li></ul><h3 id="_2024年1月3日" tabindex="-1"><a class="header-anchor" href="#_2024年1月3日" aria-hidden="true">#</a> 2024年1月3日</h3><ul><li>上午早八水课，下午疯狂做实验，同时开几个任务，把自己的搞晕了，然后将数据整理到论文中，结果发现啥也没干，蚌埠住了，感觉忙活了一天，啥也没忙活。</li></ul><h3 id="_2024年1月4日" tabindex="-1"><a class="header-anchor" href="#_2024年1月4日" aria-hidden="true">#</a> 2024年1月4日</h3><ul><li>早上起来洗澡，洗衣服</li><li>然后来实验室，发现之前的实验设置可能有点问题，然后就调整，需要重新做实验，蚌埠住了，脑子干脆是一团浆糊，自己都蒙蔽了。晚上跑的时候服务器还断了，又要重跑。</li><li>晚上水这学期最后一节课，然后继续做实验，增加了stereotype onehot embedding好像没多大差别，难崩</li></ul><h3 id="_2024年1月10日" tabindex="-1"><a class="header-anchor" href="#_2024年1月10日" aria-hidden="true">#</a> 2024年1月10日</h3><ul><li>好多天都没写了，这几天人不舒服，估计是感冒了，头晕。</li><li>还是日常做实验，感觉实验结果都不太好，我都不好写结论，太菜了。只能硬着头皮做实验，编实验。</li><li>然后开始学java了，干开发，科研根本研不下去。</li></ul><h3 id="_2024年1月19日" tabindex="-1"><a class="header-anchor" href="#_2024年1月19日" aria-hidden="true">#</a> 2024年1月19日</h3><ul><li>蚌埠住了，一下隔了这么久</li><li>前几天人一直不舒服，在寝室摆烂，然后在寝室做实验，写论文初稿，麻了，实验一做一个不吱声，基本都是烂的，</li><li>然后这几天开完会后，主力研究实验设置和实验改进，重点在于消融实验的设计，看了几篇论文，他们应用GNN在SE上和我的任务完全就不一样，麻了，只能稍微借鉴一下，然后更改了一些之前实验写的不好的地方，做了一些尝试，但是效果都不理想，想鼠。</li><li>然后服务器也一直崩，实验根本进行不下去，改了一些东西也跑不起来实验，更加奔溃了，就一直原地踏步，啥时候才能搞完这个啊，想回家啊啊啊啊啊啊</li></ul><h3 id="_2024年1月20日" tabindex="-1"><a class="header-anchor" href="#_2024年1月20日" aria-hidden="true">#</a> 2024年1月20日</h3><ul><li>实验实验太折磨了。因为更改了欠采样，metrics计算等众多地方，所以实验全都要重做。</li><li>今日完成了astnn方式的不同分类阈值，不同采样比例，以及和baseline的实验比较，不同的嵌入之间的结果又是屎一样，这玩意不用怎么编码，都可以表现的挺好，在两步和三步预测上才有点差异，麻了，我都不好作结论，不好编啊啊啊啊啊啊啊。</li><li>还有用astnn+codebert跑的好慢啊，好废内存啊，预训练模型真的太大了，完全跑不动。</li></ul><h3 id="_2024年1月21日" tabindex="-1"><a class="header-anchor" href="#_2024年1月21日" aria-hidden="true">#</a> 2024年1月21日</h3><ul><li>周末人是真少啊，今天继续做实验，codebert太慢了，感觉可以放弃了。</li><li>然后不同的model的实验结果出来了，还是差不多，GCN跑的最好，然后把论文的conclusion和threads给写了一下，astnn的编码方式都正在重新运行</li><li>最后学了一下springboot</li></ul><h3 id="_2024年1月24日" tabindex="-1"><a class="header-anchor" href="#_2024年1月24日" aria-hidden="true">#</a> 2024年1月24日</h3><ul><li>这几天都是重新跑astnn，老费时间了，然后把论文一些地方改了一下，然后tool demo论文也改了一下。</li><li>跑实验得时候就在看springboot，终于是把springboot2看完了，然后开始看spring注解驱动了</li><li>日常无聊罢了</li></ul><h3 id="_2024年1月26日" tabindex="-1"><a class="header-anchor" href="#_2024年1月26日" aria-hidden="true">#</a> 2024年1月26日</h3><ul><li>麻了，是真不想干了，这研究的什么东西啊，跑出来的东西根本就不好啊，我一直就觉得这个研究就不太合理，还得硬着头皮做，别到时候和之前学长一样，直接作废，那我真的骂娘。觉得一点前途都没有。</li><li>写的论文，画的图也跟屎一样，估计老师都无语了，还不如他自己直接写呢，反正我的东西也一点用没有，她全改了，真不是科研这块料。</li><li>学校都基本空了，大家都回家了，还要呆几天，服了，在实验室也不知道自己在干嘛，哎。</li></ul><h3 id="_2024年1月31日" tabindex="-1"><a class="header-anchor" href="#_2024年1月31日" aria-hidden="true">#</a> 2024年1月31日</h3><ul><li>这几天把FSE demo论文重新整理，搞了好几天终于是在29投出去了，然后30回家</li><li>直接被怼到自闭，纯纯科研废物。</li></ul>',24),d=[h];function n(t,s){return a(),e("div",null,d)}const c=i(r,[["render",n],["__file","24_Jan.html.vue"]]);export{c as default};
